.parallax-group{position:relative;height:100vh
}
.parallax-layer.back{pointer-events:none
}
.parallax-layer.deepest>:first-child{z-index:0
}
.parallax-layer.deep>:first-child{z-index:1
}
.parallax-layer.back>:first-child{z-index:2
