.parallax{overflow-x:hidden;overflow-y:auto;height:auto
}
@supports ((-webkit-perspective: 1px) or (perspective: 1px)) and (not (-webkit-overflow-scrolling: touch)) and (not (-ms-ime-align: auto)) and (not (-moz-appearance: meterbar)){
.parallax{-webkit-perspective:1px;perspective:1px;perspective-origin:100%;-webkit-perspective-origin:100%;height:inherit
}
.parallax-group{position:relative;height:inherit;-webkit-transform-style:preserve-3d;transform-style:preserve-3d
}
.parallax-layer{position:absolute;top:0;right:0;bottom:0;left:0;-webkit-transform-origin:100%;-ms-transform-origin:100%;transform-origin:100%
}
.parallax-layer.deepest{-webkit-transform:translateZ(-3px) scale(4);transform:translateZ(-3px) scale(4)
}
.parallax-layer.deep{-webkit-transform:translateZ(-2.5px) scale(3.5);transform:translateZ(-2.5px) scale(3.5)
}
.parallax-layer.back{-webkit-transform:translateZ(-0.5px) scale(1.5);transform:translateZ(-0.5px) scale(1.5)
}
.parallax-layer.base{-webkit-transform:translateZ(0);transform:translateZ(0);top:auto
}
}
.logo{position:absolute;left:0;right:0;margin:16.66vh auto 0;width:290px
}
@media (min-width: 360px){
.logo{width:320px
}
}
@media (min-width: 432px){
.logo{width:390px
}
}
@media (min-width: 576px){
.logo{width:495px
}
}
@media (min-width: 768px){
.logo{width:635px
}
}
.actions{text-align:center;margin-top:40px
}
@media (min-width: 576px){
.actions{margin-top:45px
}
}
@media (min-width: 768px){
.actions{margin-top:50px
}
}
.apply-btn{color:white;background-color:#222a53;border-radius:3px;text-decoration:none;padding:15px 30px;font-size:16px;font-weight:bold;-webkit-transition:all 0.15s linear;-o-transition:all 0.15s linear;transition:all 0.15s linear;-webkit-tap-highlight-color:transparent;cursor:pointer
}
.apply-btn:hover,.apply-btn:focus{background-color:#394574
}
.apply-btn:active{background-color:#13182f
}
.skyline{position:absolute;left:0;right:0;bottom:0;margin:auto auto 0;overflow:hidden;border-bottom:50px solid #e0e7f5;-webkit-filter:drop-shadow(0 5px #e0e7f5);filter:drop-shadow(0 5px #e0e7f5)
}
@media (min-width: 432px){
.skyline{border-bottom:30px solid #e0e7f5
}
}
@media (min-width: 576px){
.skyline{border-bottom:20px solid #e0e7f5
}
}
@media (min-width: 768px){
.skyline{border-bottom:none;-webkit-filter:none;filter:none
}
}
.page-content{top:100%;background:#fff
}
.feature-block{background:#fff
}
.text-contents{max-width:1200px;margin-left:auto;margin-right:auto;padding:36px
}
@media (min-width: 768px){
.text-contents{padding:60px
}
}
.text-contents h1{text-align:center
}
@media (min-width: 768px){
.text-contents h1{font-size:36px
}
}
.description{background:#222a53;color:white
}
.faq{background:#565f86;color:white
}
.faq{text-align:center
}
.faq .text-contents{text-align:left
}
.faq a{color:#d0d3e1
}
.faq-header{text-decoration:underline;font-weight:normal
}
.faq-desk{max-width:500px;margin-left:30px;margin-right:30px
}
@media only screen and (min-width: 64em){
.faq-col:last-child{padding-left:30px
}
}
.sponsor-info{max-width:1200px;text-align:center;font-weight:normal;font-size:1.14em
}
