@import url(~assets/prereg/fontello.css);
.preregister-wrapper,.preregister{height:100%
}
.preregister{display:-webkit-box;display:-ms-flexbox;display:flex;-webkit-box-align:center;-ms-flex-align:center;align-items:center;-webkit-box-pack:center;-ms-flex-pack:center;justify-content:center
}
.preregister .input-box{text-align:center
}
.preregister h1{color:#222a53;margin-bottom:10px
}
.preregister .input-wrapper{border:2px solid #222a53;-webkit-transition:all 0.25s;-o-transition:all 0.25s;transition:all 0.25s;width:290px;margin:15px 0 5px;border-radius:2px
}
.preregister input{margin:0px;outline:none;border:none;font-size:13.333px
}
.preregister input[type="text"],.preregister input[type="email"]{background:transparent;padding-right:0px;margin-right:0px;font-family:'Sofia Pro', sans-serif;color:#222a53;font-size:14px;padding:10px;width:240px
}
.preregister .fa,.preregister input[type="submit"]{-webkit-transition:all 0.25s;-o-transition:all 0.25s;transition:all 0.25s
}
.preregister input[type="submit"]{margin-top:10px;font-family:'Sofia Pro', sans-serif;width:290px;color:white;background-color:#222a53;border-radius:2px;-webkit-border-radius:2px;text-decoration:none;padding:10px 30px;font-size:16px;font-weight:bold;-webkit-transition:all 0.15s linear;-o-transition:all 0.15s linear;transition:all 0.15s linear;-webkit-tap-highlight-color:transparent
}
.preregister input[type="submit"]:hover,.preregister input[type="submit"]:focus{background-color:#394574
}
.preregister input[type="submit"][disabled]{opacity:0.5;background-color:#222a53
}
.preregister input[type="submit"]:active{background-color:#13182f
}
.preregister .fa{color:#222a53;padding:9px
}
.preregister .icon-attention-circled{color:#c75566
}
.preregister .input-wrapper.attention{border:2px solid #c75566
}
.preregister .status-message{color:#222a53;font-size:1.33em;padding:50px
}
@media (max-width: 575px){
.preregister .status-message{font-size:1.14em;padding:20px
}
}
.prereg-close{position:fixed;top:32px;right:32px;height:24px;width:24px;-webkit-transition:all 0.25s;-o-transition:all 0.25s;transition:all 0.25s;cursor:pointer;-webkit-tap-highlight-color:transparent
}
.prereg-close:hover{opacity:0.75
}
.prereg-close:active{-webkit-transform:scale(0.93);-ms-transform:scale(0.93);transform:scale(0.93)
}
@media (max-width: 575px){
.prereg-close{top:24px;right:24px;height:16px;width:16px
}
}
